db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5de80f6110322c613229c502") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8db0ccc446376c1110e7c") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5e0083823a608c03bc854b3c"), contentType: 'NEWS', title: 'Has Ethiopia achieved a 4 billion trees\' planting target this year?', description: 'Ethiopia undertook a major national reforestation programme this year, with the ambitious target of planting four billion trees in just three months.\n\nThe highlight was a single day in July, on which people across the country turned out to help with planting 350 million tree seedlings.\n\nAt the end of August, the government claimed to have just about achieved these goals. But is it really possible to plant that many trees in such a short time and what evidence is there that the overall target has been met?\n\nThe campaign, known as the Green Legacy Initiative, has been championed by the country\'s Nobel peace prize-winning Prime Minister, Abiy Ahmed.\n\nPoliticians around the world have pointed to Ethiopia as an example of what can be done to reforest their own countries and reverse the effects of both damaging farming techniques and climate change.\n\nDuring the recent UK election campaign, major political parties made expansive promises to plant millions more trees, and referred to Ethiopia\'s initiative.\n\nThe Labour party pledged to plant two billion trees by 2040, the Conservatives at least 30 million more trees every year, and the Green Party 700 million by 2030.\n\nCanada has plans to plant two billion trees over 10 years.\n\nRecord breaking attempt\n\nEthiopia held a one-day tree planting event on 29 July, with an initial target to plant 200 million tree saplings across the country.\n\nThe government announced that the target had been exceeded, with more than 350 million planted over a 12-hour period. They gave a very precise number - 353,633,660 trees planted that day.\n\nThe government had promoted the day as an attempt at an official Guinness World Record (GWR). But GWR told the BBC they are yet to receive any evidence.\n\n"We would encourage the organisers to get in touch with this for our records management team to review," said spokeswoman Jessica Spillane.\n\nThe prime minister\'s office declined to comment on the figures and the status of the record verification, saying the country has already answered most questions around the tree planting.', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/ETHIOPIA_1576819030-e062050a5f41eaa5340c09b65d14a270.jpg', series: [], referenceChannelID: null, createdAt: new Date("Mon, 23 Dec 2019 09:06:10 GMT"), updatedAt: new Date("Mon, 23 Dec 2019 09:06:10 GMT"), __v: 0 }, { session: null })
db.searchcontentmodels.insertOne({ _id: ObjectId("5e0083823a608c03bc854b3d"), contentId: ObjectId("5e0083823a608c03bc854b3c"), name: 'Has Ethiopia achieved a 4 billion trees\' planting target this year?|Ethiopia undertook a major national reforestation programme this year, with the ambitious target of planting four billion trees in just three months.\n\nThe highlight was a single day in July, on which people across the country turned out to help with planting 350 million tree seedlings.\n\nAt the end of August, the government claimed to have just about achieved these goals. But is it really possible to plant that many trees in such a short time and what evidence is there that the overall target has been met?\n\nThe campaign, known as the Green Legacy Initiative, has been championed by the country\'s Nobel peace prize-winning Prime Minister, Abiy Ahmed.\n\nPoliticians around the world have pointed to Ethiopia as an example of what can be done to reforest their own countries and reverse the effects of both damaging farming techniques and climate change.\n\nDuring the recent UK election campaign, major political parties made expansive promises to plant millions more trees, and referred to Ethiopia\'s initiative.\n\nThe Labour party pledged to plant two billion trees by 2040, the Conservatives at least 30 million more trees every year, and the Green Party 700 million by 2030.\n\nCanada has plans to plant two billion trees over 10 years.\n\nRecord breaking attempt\n\nEthiopia held a one-day tree planting event on 29 July, with an initial target to plant 200 million tree saplings across the country.\n\nThe government announced that the target had been exceeded, with more than 350 million planted over a 12-hour period. They gave a very precise number - 353,633,660 trees planted that day.\n\nThe government had promoted the day as an attempt at an official Guinness World Record (GWR). But GWR told the BBC they are yet to receive any evidence.\n\n"We would encourage the organisers to get in touch with this for our records management team to review," said spokeswoman Jessica Spillane.\n\nThe prime minister\'s office declined to comment on the figures and the status of the record verification, saying the country has already answered most questions around the tree planting.|News|Africa|Africa|', __v: 0 }, { session: null })
db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5deb724e16c2ad315f2d02ab") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d283"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2e6"), ObjectId("5de8b686641f4253ad09d2f8"), ObjectId("5de8b686641f4253ad09d301") ], subCategories: [ ObjectId("5de8db47cc446376c1110e84") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5e0084193a608c03bc854b3e"), contentType: 'NEWS', title: 'Tanzanians are vulnerable to falling back into poverty at the slightest shock: World Bank', description: 'Poverty is declining in Tanzania according to a new World Bank report, but nearly half the population still lives on less than $1.90 per day.\n\n“Further reduction in poverty is welcome news,” said Bella Bird, the World Bank country director for Tanzania, Zimbabwe, Zambia and Malawi. “But it is important to accelerate the trend, as the number of the poor is still high, and the majority of Tanzanians are vulnerable to falling back into poverty at the slightest shock.”\n\nThe World Bank said that it had confirmed that the government’s “basic needs poverty rate” had declined from 34.4 per cent in 2007 to 28.2 per cent in 2012, and to a further 26.4 per cent in 2018.\n\nThe report, issued last week, said that mainland Tanzania “recorded sustained economic growth and poverty reduction over the past decade, (although) the poverty reducing impact of economic growth has been slowing down”.\n\nThe World Bank says that there are “emerging signs of a structural transformation” in the economy that can be seen in the increasing share of industry and services in total employment. Agriculture is employing fewer workers, and those who remain in the sector are diversifying towards non-farm wage and self-employment.\n\n“With an increase in the economic returns outside agriculture, there is a growing need for investments in human capital especially among the poor and the vulnerable. Increasing access to productive employment opportunities is key to sustaining the momentum picked up during the past decade,” Ms Bird said.\n\nKey findings included improved access to basic services like water and sanitation facilities, as well as energy. School enrolment rates have also increased, and a higher proportion of the labour force is working in secondary and tertiary sectors.\n\nHowever, despite these improvements, “overall education level and access to basic services remain low, particularly for the poorest and for those living in rural areas. This is reflected in recent growth being less pro-poor, widening the welfare gap between the rich and the poor”.\n\nThe World Bank says that poor people in Tanzania still have “limited access to better job opportunities”, adding that persistent high population growth “is a major challenge for poverty reduction efforts, but it can be a huge opportunity with the right investments and policy initiatives”.', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/jeff_poverty_1576767809-bb58697dda376a87a65639d03d8603af.jpg', series: [], referenceChannelID: null, createdAt: new Date("Mon, 23 Dec 2019 09:08:41 GMT"), updatedAt: new Date("Mon, 23 Dec 2019 09:08:41 GMT"), __v: 0 }, { session: null })
db.searchcontentmodels.insertOne({ _id: ObjectId("5e0084193a608c03bc854b3f"), contentId: ObjectId("5e0084193a608c03bc854b3e"), name: 'Tanzanians are vulnerable to falling back into poverty at the slightest shock: World Bank|Poverty is declining in Tanzania according to a new World Bank report, but nearly half the population still lives on less than $1.90 per day.\n\n“Further reduction in poverty is welcome news,” said Bella Bird, the World Bank country director for Tanzania, Zimbabwe, Zambia and Malawi. “But it is important to accelerate the trend, as the number of the poor is still high, and the majority of Tanzanians are vulnerable to falling back into poverty at the slightest shock.”\n\nThe World Bank said that it had confirmed that the government’s “basic needs poverty rate” had declined from 34.4 per cent in 2007 to 28.2 per cent in 2012, and to a further 26.4 per cent in 2018.\n\nThe report, issued last week, said that mainland Tanzania “recorded sustained economic growth and poverty reduction over the past decade, (although) the poverty reducing impact of economic growth has been slowing down”.\n\nThe World Bank says that there are “emerging signs of a structural transformation” in the economy that can be seen in the increasing share of industry and services in total employment. Agriculture is employing fewer workers, and those who remain in the sector are diversifying towards non-farm wage and self-employment.\n\n“With an increase in the economic returns outside agriculture, there is a growing need for investments in human capital especially among the poor and the vulnerable. Increasing access to productive employment opportunities is key to sustaining the momentum picked up during the past decade,” Ms Bird said.\n\nKey findings included improved access to basic services like water and sanitation facilities, as well as energy. School enrolment rates have also increased, and a higher proportion of the labour force is working in secondary and tertiary sectors.\n\nHowever, despite these improvements, “overall education level and access to basic services remain low, particularly for the poorest and for those living in rural areas. This is reflected in recent growth being less pro-poor, widening the welfare gap between the rich and the poor”.\n\nThe World Bank says that poor people in Tanzania still have “limited access to better job opportunities”, adding that persistent high population growth “is a major challenge for poverty reduction efforts, but it can be a huge opportunity with the right investments and policy initiatives”.|News|Tanzania|Tanzania|', __v: 0 }, { session: null })
